function rowLimiter(e,i){$(e).each(function(){var e=$(this).height(),t=$(this).css("line-height"),n=e/(t=parseFloat(t));n=Math.round(n);var s=$(this).text().length,a=Math.floor(s/n*i-5);n>i&&$(this).text($(this).text().substr(0,a)+"...")})}$(document).ready(function(){new Swiper(".advert-slider",{slidesPerView:6,spaceBetween:30,loop:!0,loopFillGroupWithBlank:!0,pagination:{el:".swiper-pagination",clickable:!0},navigation:{nextEl:".vip-section .swiper-button-next",prevEl:".vip-section .swiper-button-prev"},breakpoints:{1199:{slidesPerView:5,spaceBetween:10},767:{slidesPerView:3,spaceBetween:10},575:{slidesPerView:2,spaceBetween:20},375:{slidesPerView:2,spaceBetween:10}}}),new Swiper(".banners-slider",{spaceBetween:30,centeredSlides:!0,autoplay:{delay:2500,disableOnInteraction:!1},pagination:{el:".swiper-pagination",clickable:!0},navigation:{nextEl:".swiper-button-next",prevEl:".swiper-button-prev"}})}),rowLimiter(".line-limit",2);